  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Seedskadee
  National Wildlife Refuge outlines Refuge accomplishments during the 1980 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, and safety is given. Habitat management
  is also covered; subjects include wetlands, croplands, grasslands, grazing, and
  fire management. The wildlife section of the report discusses wildlife diversity,
  endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
  raptors, game mammals, animal control, marking and bird banding, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  hunting, fishing, trapping, and law enforcement. The equipment and facilities section
  of the report provides information about new construction, rehabilitation, major
  maintenance, equipment replacement, communication systems, and energy conservation.
  Cooperative programs and items of interest are provided at the end.\",\n\t\"owner_org\":
